import * as React from "react";
import type { SVGProps } from "react";
import avatar from "../Assets/AvatarImages/1.png";
import * as sdk from "microsoft-cognitiveservices-speech-sdk";

import viseme_id_0 from "../Assets/visemes/viseme_id_0.svg";
import viseme_id_1 from "../Assets/visemes/viseme_id_1.svg";
import viseme_id_2 from "../Assets/visemes/viseme_id_2.svg";
import viseme_id_3 from "../Assets/visemes/viseme_id_3.svg";
import viseme_id_4 from "../Assets/visemes/viseme_id_4.svg";
import viseme_id_5 from "../Assets/visemes/viseme_id_5.svg";
import viseme_id_6 from "../Assets/visemes/viseme_id_6.svg";
import viseme_id_7 from "../Assets/visemes/viseme_id_7.svg";
import viseme_id_8 from "../Assets/visemes/viseme_id_8.svg";
import viseme_id_9 from "../Assets/visemes/viseme_id_9.svg";
import viseme_id_10 from "../Assets/visemes/viseme_id_10.svg";
import viseme_id_11 from "../Assets/visemes/viseme_id_11.svg";
import viseme_id_12 from "../Assets/visemes/viseme_id_12.svg";
import viseme_id_13 from "../Assets/visemes/viseme_id_13.svg";
import viseme_id_14 from "../Assets/visemes/viseme_id_14.svg";
import viseme_id_15 from "../Assets/visemes/viseme_id_15.svg";
import viseme_id_16 from "../Assets/visemes/viseme_id_16.svg";
import viseme_id_17 from "../Assets/visemes/viseme_id_17.svg";
import viseme_id_18 from "../Assets/visemes/viseme_id_18.svg";
import viseme_id_19 from "../Assets/visemes/viseme_id_19.svg";
import viseme_id_20 from "../Assets/visemes/viseme_id_20.svg";
import viseme_id_21 from "../Assets/visemes/viseme_id_21.svg";

import { useState } from "react";
import Speakers from "../configs/Speakers";

const config = require("../config.json");
var visemes_arr: Array<sdk.SpeechSynthesisVisemeEventArgs> = [];

function Avatar(props: SVGProps<SVGSVGElement>) {
  interface IMap {
    [key: string]: string;
  }

  const visemeMap: IMap = {
    0: viseme_id_0,
    1: viseme_id_1,
    2: viseme_id_2,
    3: viseme_id_3,
    4: viseme_id_4,
    5: viseme_id_5,
    6: viseme_id_6,
    7: viseme_id_7,
    8: viseme_id_8,
    9: viseme_id_9,
    10: viseme_id_10,
    11: viseme_id_11,
    12: viseme_id_12,
    13: viseme_id_13,
    14: viseme_id_14,
    15: viseme_id_15,
    16: viseme_id_16,
    17: viseme_id_17,
    18: viseme_id_18,
    19: viseme_id_19,
    20: viseme_id_20,
    21: viseme_id_21,
  };
  // define the states
  const [imageIndex, setImageIndex] = useState(0);
  const [selectedVoice, setSelectedVoice] =
    useState<string>("en-GB-BellaNeural"); //default voice
  const [sentence, setSelectedSentence] = useState<string>("");
  //"Hi! I am your virtual friend"

  /*const sentences = [
    "hello how are you doing today",
    "இன்று வானிலை அருமையாக உள்ளது.",
    "நன்றி, உங்களுடன் பேசுவது மகிழ்ச்சி.",
    "தமிழ் ஒரு அழகான மொழி.",
  ];*/

  //Function to synthesize speech and handle viseme events
  function synthesizeSpeech() {
    //My subscription details
    const speechConfig = sdk.SpeechConfig.fromSubscription(
      config.SpeechKey,
      config.SpeechRegion
    );

    const speechSynthesizer = new sdk.SpeechSynthesizer(speechConfig); //responsible for converting tts & handle viseme events
    //configuration for ssml
    const ssml = `<speak version='1.0' xml:lang='en-US' xmlns='http://www.w3.org/2001/10/synthesis' xmlns:mstts='http://www.w3.org/2001/mstts'> \r\n \
                  <voice name='${selectedVoice}'> \r\n \        
                  <mstts:viseme type='redlips_front'/> \r\n \
                  ${sentence} \r\n \
                  </voice> \r\n \
                  </speak>`;

    // Subscribes to viseme received event
    speechSynthesizer.visemeReceived = function (s, e) {
      //s = sender object, e = event object => contains audio offset & viseme id
      window.console.log(
        "(Viseme), Audio offset: " +
          e.audioOffset / 10000 +
          "ms. Viseme ID: " +
          e.visemeId
      );

      visemes_arr.push(e);
    };
    //Asynchronouus speech synthesis operation starts here
    speechSynthesizer.speakSsmlAsync(
      ssml, //contains the string to be synthesized
      (result) => {
        if (result.errorDetails) {
          console.error(result.errorDetails); //error handling = errors logged to console
        } else {
          console.log(JSON.stringify(result));
          visemes_arr.forEach((e) => {
            var duration = e.audioOffset / 10000; //for each viseme event, duration to display visime calculated, setimageindex called to update visimeid
            setTimeout(() => {
              setImageIndex(e.visemeId);
            }, duration);
          });
        }

        visemes_arr = [];
        speechSynthesizer.close();
      },
      (error) => {
        console.log(error);
        visemes_arr = [];
        speechSynthesizer.close();
      }
    );
  }
  //When user clicks the speak button
  const handleClick = () => {
    //const randomIndex = Math.floor(Math.random() * sentences.length); //generates random index based on no. of sentences available
    //setSelectedSentence(sentences[randomIndex]);
    if (!sentence.trim()) {
      alert("Please enter text to speak.");
      return;
    }
    synthesizeSpeech();
  };
  //when user changes voice
  const handleVoiceChange = (event: React.ChangeEvent<HTMLSelectElement>) => {
    setSelectedVoice(event.target.value);
  };
  return (
    <div>
      <div className="Title">Text to Speech 2D Animator</div>
      <br></br>
      <svg
        xmlns="http://www.w3.org/2000/svg"
        xmlnsXlink="http://www.w3.org/1999/xlink"
        width="500"
        height="500"
        fill="none"
        viewBox="0 0 500 500"
        {...props}
      >
        <path fill="url(#avatar_svg__a)" d="M194 270h112v65H194z" />
        <path fill="url(#avatar_svg__b)" d="M0 0h500v500H0z" />
        <defs>
          <pattern
            id="avatar_svg__a"
            width={1}
            height={1}
            patternContentUnits="objectBoundingBox"
          >
            <use
              xlinkHref="#avatar_svg__c"
              transform="matrix(.0011 0 0 .0019 0 -.319)"
            />
          </pattern>
          <pattern
            id="avatar_svg__b"
            width={1}
            height={1}
            patternContentUnits="objectBoundingBox"
          >
            <use xlinkHref="#avatar_svg__d" transform="scale(.002)" />
          </pattern>
          <image
            xlinkHref="data:image/png;base64,"
            id="avatar_svg__c"
            width={500}
            height={500}
          />
          <image
            xlinkHref={visemeMap[imageIndex]}
            id="avatar_svg__d"
            width={512}
            height={488}
          />
        </defs>
      </svg>
      <div className="options">
        <select value={selectedVoice} onChange={handleVoiceChange}>
          {Speakers.map((voice) => (
            <option value={voice.value}>{voice.label}</option>
          ))}
        </select>
      </div>
      <div className="input-area">
        <input
          type="text"
          value={sentence}
          onChange={(e) => setSelectedSentence(e.target.value)}
          placeholder="Type something to speak..."
          style={{ width: "400px", padding: "10px", marginBottom: "10px" }}
        />
      </div>
      <button className="button" onClick={handleClick}>
        Speak
      </button>
    </div>
  );
}
export default Avatar;
